import React from "react";
import { motion } from "framer-motion";
import Allproducts from '../'
const DashBoard = () => {
  return <>
     <div className="container">
      <motion.p transition={{ duration:1 }} initial={{ x:-100 }} animate={{ x:200 }} className="text-dark display-5"  >  
        
          Welcome to Ghazi Fabric Admin panel
         </motion.p>


         <Allproducts/>
     </div>
  </>;
};

export default DashBoard;
